import React from 'react';
import {BootstrapTable, TableHeaderColumn} from "react-bootstrap-table";


const Order = ({products,orders}) => {
    orders.map(order=>{
        const product = products.filter(product=>(product['_id']===order['productId']))
        // const product0=product[0]
        // console.log(1,product0.price)
        // console.log(2,order.num)
        order['price']= (product[0]['price']*order['num']).toFixed(2)
    })
    // console.log(1,orders)
    return (
        <div>
            <BootstrapTable data={orders} insertRow={true} search={true}>
                <TableHeaderColumn isKey dataField='_id'>Order ID</TableHeaderColumn>
                <TableHeaderColumn dataField='customerId'>Customer Id</TableHeaderColumn>
                <TableHeaderColumn dataField='productId' >Product Id</TableHeaderColumn>
                <TableHeaderColumn dataField='num' searchable={false}>Number</TableHeaderColumn>
                <TableHeaderColumn dataField='nation' searchable={false}>Nation</TableHeaderColumn>
                <TableHeaderColumn dataField='price' searchable={false}>Price</TableHeaderColumn>

            </BootstrapTable>
        </div>
    );
}


export default Order;
